'''Thessalia''' runs [[Thessalia's Fine Clothes]] and [[Thessalia's Makeovers]] in [[Varrock]]. Items of clothing can be bought from her, or for {{Coins|500}} a player can get a [[Thessalia's Makeovers|clothing makeover]] to change the clothing underneath their worn items. To change both upper and lower body clothing costs a total of {{Coins|1000}}. She also exchanges [[frog token]]s for a [[prince outfit]]/[[princess outfit]] or a [[frog mask]]. She will also return [[bunny ears]] and [[scythe]]s to a player if they have lost them.

